import React, { useState, useEffect } from "react";
import axiosInstance from "../utils/axiosInstance"; // Import the pre-configured axios instance

const ManageTrainSchedules = () => {
  const [trainSchedules, setTrainSchedules] = useState([]);
  const [newSchedule, setNewSchedule] = useState({
    trainID: "",
    transitLineName: "",
    departureDateTime: "",
    arrivalDateTime: "",
  });
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchTrainSchedules = async () => {
      try {
        const response = await axiosInstance.get("/admin/train-schedules"); // Use axiosInstance
        if (response.data && Array.isArray(response.data.trainSchedules)) {
          setTrainSchedules(response.data.trainSchedules);
        } else {
          setTrainSchedules([]);
          setError("No train schedules available.");
        }
      } catch (err) {
        console.error("Error fetching train schedules:", err);
        setError("Failed to fetch train schedules. Try again later.");
      }
    };
    fetchTrainSchedules();
  }, []);

  const handleAddSchedule = async () => {
    try {
      const response = await axiosInstance.post("/admin/train-schedules", newSchedule); // Use axiosInstance
      if (response.data) {
        setTrainSchedules([...trainSchedules, response.data.newSchedule]);
        setNewSchedule({
          trainID: "",
          transitLineName: "",
          departureDateTime: "",
          arrivalDateTime: "",
        });
      }
    } catch (err) {
      console.error("Error adding train schedule:", err);
      setError("Failed to add train schedule. Try again later.");
    }
  };

  return (
    <div>
      <h1>Manage Train Schedules</h1>
      {error && <p style={{ color: "red" }}>{error}</p>}
      <table>
        <thead>
          <tr>
            <th>Schedule ID</th>
            <th>Train ID</th>
            <th>Transit Line Name</th>
            <th>Departure DateTime</th>
            <th>Arrival DateTime</th>
          </tr>
        </thead>
        <tbody>
          {trainSchedules.map((schedule) => (
            <tr key={schedule.ScheduleID}>
              <td>{schedule.ScheduleID}</td>
              <td>{schedule.TrainID}</td>
              <td>{schedule.TransitLineName}</td>
              <td>{schedule.DepartureDateTime}</td>
              <td>{schedule.ArrivalDateTime}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <h2>Add New Train Schedule</h2>
      <form
        onSubmit={(e) => {
          e.preventDefault();
          handleAddSchedule();
        }}
      >
        <input
          type="text"
          placeholder="Train ID"
          value={newSchedule.trainID}
          onChange={(e) => setNewSchedule({ ...newSchedule, trainID: e.target.value })}
          required
        />
        <input
          type="text"
          placeholder="Transit Line Name"
          value={newSchedule.transitLineName}
          onChange={(e) => setNewSchedule({ ...newSchedule, transitLineName: e.target.value })}
          required
        />
        <input
          type="datetime-local"
          placeholder="Departure DateTime"
          value={newSchedule.departureDateTime}
          onChange={(e) =>
            setNewSchedule({ ...newSchedule, departureDateTime: e.target.value })
          }
          required
        />
        <input
          type="datetime-local"
          placeholder="Arrival DateTime"
          value={newSchedule.arrivalDateTime}
          onChange={(e) =>
            setNewSchedule({ ...newSchedule, arrivalDateTime: e.target.value })
          }
          required
        />
        <button type="submit">Add Schedule</button>
      </form>
    </div>
  );
};

export default ManageTrainSchedules;
